            accord2: "Lorem 3"
        },
    ]

    return (
        <div>
            <MainLayout>
                <Header />
                <Container fixed>
                    <ListCards list={ listCard } />
                    <Forms />
                </Container>
            </MainLayout>
        </div>
    );
};

export default Home;
